import React, { Fragment } from 'react';
import { Button } from 'react-bootstrap';
export default function NavBar() {
	return (
		<Fragment >
            <div className='navBar'>
            <Button variant="primary">Click me!</Button>
            </div>
		</Fragment>
	);
}
